import React from 'react';
import ListElement from './ListElement/ListElement';

const list = (props) => {
    //console.log(props.classForBtn);
    return (
        <ul>
            <li onClick={props.return} className={props.classForBtn}>Nazad</li>
            <ListElement
            elements={props.elements}
            click={props.clicked}/>
        </ul>
    );
};      


export default list;
